import React from 'react'
import Shopdata from './shopdata'
import CollectionPreview from '../../components/preview-collection/previewCollection'
import { createStructuredSelector } from 'reselect'
import { SelectCollections } from '../../redux/shopdata/shopData.selector'
import { connect } from 'react-redux'

const ShopPage = ({collections}) =>
   (
            <div className='shop-page'>
            {collection.map(({ id, ...otherSectionProps}) => (
                    <CollectionPreview key={id} {...otherSectionProps}/>
                ))}
            </div>
        )
const mapStateToProps = createStructuredSelector({
    collection: SelectCollections
})

export default connect(mapStateToProps)(ShopPage)
